////////////////////////////////////////////////////////////////////////////////////
// 2.7 Non-overlapping Template Matching Test
// https://nvlpubs.nist.gov/nistpubs/Legacy/SP/nistspecialpublication800-22r1a.pdf
////////////////////////////////////////////////////////////////////////////////////
bool NonOverlapTest(const BitSequence* epsilon, size_t n, const BitSequence* mask, size_t m, size_t N)
{
	// проверить применимость теста
	size_t M = n/ N; if (m - 1 >= M) return false; 
	try {
		// для всех блоков последовательности (вычислить 2.7.4.2)
		std::vector<size_t> W(N); for (size_t i = 0; i < N; i++) 
		{
			// для всех скользящих окон
			for (size_t j = 0; j < M - (m - 1); j++) 
			{
				// проверить совпадение с шаблоном
				if (memcmp(&epsilon[i * M + j], mask, m) == 0) 
				{
					// сместить скользящее окно
					W[i]++; j += m - 1; 
				}
			}
		}
		// вычислить 2.7.4.3
		double mu = (M - (m - 1)) / pow(2.0, (double)m); double chi2 = 0.0;

		// вычислить 2.7.4.3
		double sigma2 = M * (1 / pow(2.0, (double)m) - (2.0 * m - 1) / pow(2.0, 2.0 * m)); 

		// вычислить 2.7.4.4
		for (size_t i = 0; i < N; i++) 
		{
			chi2 += (W[i] - mu) * (W[i] - mu);
		}
		chi2 /= sigma2; 

		// вычислить 2.7.4.5
		double p_value = igamc(N / 2.0, chi2 / 2.0);
		
		// выполнить 2.7.5
		return (p_value >= 0.01); 
	}
	// обработать возможную ошибку
	catch (const std::exception &) { return false; }
}

bool NonOverlapTest(const BitSequence* epsilon, size_t n, const BitSequence* mask, size_t m)
{
	// выполнить тест
	return NonOverlapTest(epsilon, n, mask, m, 8); 
}

bool NonOverlapTest(const BitSequence* epsilon, size_t n, size_t m)
{		
	// число неудачных тестов
	size_t failTests = 0; size_t allTests = templates[m].count; 

	// для всех шаблонов
	for (size_t i = 0; i < allTests; i++)
	{
		// выполнить тест 
		if (!NonOverlapTest(epsilon, n, &templates[m].masks[i * m], m)) failTests++; 
	}
	// проверить число неудачных тестов
	return (failTests * 100) <= allTests * 15; 
}

